import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

 const name = "rajendra";
  const img2 = "https://picsum.photos/200/300/?blur=2";
  const img1 = "https://picsum.photos/seed/picsum/200/300"; 
  const img3 = "https://picsum.photos/id/870/200/300?grayscale&blur=2";
  const link1 = "http://github.com/shrivastav1811";

  const heading = {
    color : "red",
    fontSize: "30px",
    textAlign: "center",
    textTransform: "capitalize",
    fontWeight: "bold",
    margin: "50px 0",
}



ReactDOM.render(
  <>
  <h1 style={heading}> My Name is {name} </h1>
  <div id="img"> 
  <img src={img1} alt="random image" />
  <img src={img2} alt="random image" />
  <img src={img3} alt="random image" /> 

  <a href={link1} target="_blank"> Click On me </a>
  </div>
  </>,
  document.getElementById('root')
);
